import React from 'react';

function formatDate(ts) {
  if (!ts) return '-';
  const date = new Date(ts);
  return date.toLocaleString('es-AR', { hour12: false });
}

function SessionsList({ sessions, onBack }) {
  return (
    <div className="max-w-4xl mx-auto mt-6">
      <div className="flex items-center justify-between mb-4">
        <h2 className="text-xl font-bold">Historial de sesiones</h2>
        <button onClick={onBack} className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700">Volver</button>
      </div>
      <div className="overflow-x-auto">
        <table className="min-w-full bg-white rounded shadow">
          <thead>
            <tr className="bg-gray-100 text-gray-700 text-left">
              <th className="px-4 py-2">Cargador</th>
              <th className="px-4 py-2">Conector</th>
              <th className="px-4 py-2">Inicio</th>
              <th className="px-4 py-2">Fin</th>
              <th className="px-4 py-2">Duraci√≥n (min)</th>
            </tr>
          </thead>
          <tbody>
            {sessions.length === 0 && (
              <tr>
                <td colSpan="5" className="text-center text-gray-400 py-6">No hay sesiones registradas.</td>
              </tr>
            )}
            {sessions.map((s, idx) => (
              <tr key={idx} className="border-b last:border-none">
                <td className="px-4 py-2">{s.chargerName}</td>
                <td className="px-4 py-2">{s.connectorType}</td>
                <td className="px-4 py-2">{formatDate(s.start)}</td>
                <td className="px-4 py-2">{s.end ? formatDate(s.end) : <span className="text-orange-600 font-semibold">Activa</span>}</td>
                <td className="px-4 py-2">{s.durationMinutes}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default SessionsList;
